leaderboard_chart.query:
q = load "${App.Datasets.Pricing_tp.FullyQualifiedName}";
q = filter q by 'IsScored' == "true";
q = filter q by 'SBQQ_Quote_r_SBQQ_Opportunity2_r_IsWon' == "true";
q = group q by ('SBQQ_Quote_r_SBQQ_SalesRep_r_UniqueUserName', 'SBQQ_Quote_r_SBQQ_Opportunity2_r_Id');
q = foreach q generate 'SBQQ_Quote_r_SBQQ_SalesRep_r_UniqueUserName' as 'SBQQ_Quote_r_SBQQ_SalesRep_r_UniqueUserName', 'SBQQ_Quote_r_SBQQ_Opportunity2_r_Id' as 'SBQQ_Quote_r_SBQQ_Opportunity2_r_Id', first('SBQQ_Quote_r_SBQQ_SalesRep_r_SmallPhotoUrl') as 'SBQQ_Quote_r_SBQQ_SalesRep_r_SmallPhotoUrl', sum('SBQQ_CustomerTotal__c') as 'SBQQ_CustomerTotal__c', max('SBQQ_TotalDiscountRate__c') as 'Discount', (1 - max('Recommended_Discount__c')/100) * max('SBQQ_ListTotal__c') as 'Predicted', max('Recommended_Discount__c')/100 as 'RecDisc', max('SBQQ_ListTotal__c') as 'ListPrice';
q = group q by 'SBQQ_Quote_r_SBQQ_SalesRep_r_UniqueUserName';
q = foreach q generate 'SBQQ_Quote_r_SBQQ_SalesRep_r_UniqueUserName' as 'SBQQ_Quote_r_SBQQ_SalesRep_r_UniqueUserName', first('SBQQ_Quote_r_SBQQ_SalesRep_r_SmallPhotoUrl') as 'SBQQ_Quote_r_SBQQ_SalesRep_r_SmallPhotoUrl', round(coalesce(sum('SBQQ_CustomerTotal__c')/sum('Predicted'),0),2) as 'Actual Revenue/Expected Revenue';
q = order q by 'Actual Revenue/Expected Revenue' asc;

waterfall_chart.query:
q = load "${App.Datasets.Pricing_tp.FullyQualifiedName}";
q = filter q by 'SBQQ_Quote_r_SBQQ_Opportunity2_r_IsWon' == "true";
q = group q by ('SBQQ_Quote_r_SBQQ_Opportunity2_r_Id', 'IsScored');
q = foreach q generate 'SBQQ_Quote_r_SBQQ_Opportunity2_r_Id' as 'SBQQ_Quote_r_SBQQ_Opportunity2_r_Id', 'IsScored' as 'IsScored', sum('SBQQ_CustomerTotal__c') as 'SBQQ_CustomerTotal__c', max('SBQQ_TotalDiscountRate__c') as 'Discount', (1 - (max('Recommended_Discount__c') / 100)) * max('SBQQ_ListTotal__c') as 'Predicted', max('Recommended_Discount__c') / 100 as 'RecDisc', max('SBQQ_ListTotal__c') as 'ListPrice', max('Pricing_Score') as 'Pricing_Score';
predicted = filter q by 'IsScored' == "true";
predicted = group predicted by all;
predicted = foreach predicted generate "1_Predicted Revenue" as 'Bin', sum('Predicted') as 'sum_Amount';
incremental = filter q by 'IsScored' == "true";
incremental = filter incremental by 'Pricing_Score' >= 1;
incremental = group incremental by all;
incremental = foreach incremental generate "2_Gained Revenue" as 'Bin', sum('SBQQ_CustomerTotal__c') - sum('Predicted') as 'sum_Amount';
lost = filter q by 'IsScored' == "true";
lost = filter lost by 'Pricing_Score' < 1;
lost = group lost by all;
lost = foreach lost generate "4_Missed Revenue" as 'Bin', sum('SBQQ_CustomerTotal__c') - sum('Predicted') as 'sum_Amount';
unscored = filter q by 'IsScored' == "false";
unscored = group unscored by all;
unscored = foreach unscored generate "3_Unscored Revenue" as 'Bin', sum('SBQQ_CustomerTotal__c') as 'sum_Amount';
results = union predicted, incremental, lost, unscored;
results = group results by 'Bin';
results = foreach results generate 'Bin', sum('sum_Amount') as 'sum_Amount';

